import React, {Component} from "react";
import './App.css';
import tasks from './sample/task.json';
import Tasks from './components/tasks'


class App extends Component{

  state = {
    tasks: tasks
  }

  render(){
    return(
      <div>
        {this.state.tasks.map( e => <p key={e.id}>{e.id} - {e.titulo} - {e.estado}</p>)}
      </div>
    )
  }
}

export default App;
